import React, { Component } from "react";
import {Modal} from "reactstrap";

const Alert = (props) => {

    return (
        <Modal isOpen={props.isOpen} toggle={props.handleCreateClick} >

            {props.renderContent}

        </Modal>
    )

}

export default Alert;
